import React,  { useState , Component  } from 'react';

import{Offcanvas
  ,OffcanvasHeader
  ,OffcanvasBody,Button
} from 'reactstrap';
class Off_canvas extends Component {

    constructor(props){
        super(props);
        this.state = { counter: 0 };
    }
    render() {
      return <div>
      <Button
        color="primary"
        onClick={function noRefCheck(){}}
      >
        Open
      </Button>
      <Offcanvas
        direction="end"
        scrollable
        toggle={function noRefCheck(){}}
      >
        <OffcanvasHeader toggle={function noRefCheck(){}}>
          Offcanvas
        </OffcanvasHeader>
        <OffcanvasBody>
          <strong>
            This is the Offcanvas body.
          </strong>
        </OffcanvasBody>
      </Offcanvas>
    </div>;
    }
  }






export {Off_canvas}
